import React, { Component } from 'react';

// import './App.scss';

class lockedWork extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div><h1>To view this work please reach out to me directly.</h1></div>
      </div>
    );
  }
}

export default lockedWork;
